dict.string:
// element - DOMHTMLElement that triggered this function being called
// event - event that triggered this function being called
function leftRightArrowKeys(hypeDocument, element, event) {
	var key = function (e) {

e = e || window.event;
var k = e.keyCode || e.which;

if (k == 39) {
hypeDocument.showNextScene();
};

if (k == 37) {
hypeDocument.showPreviousScene();
};
};

document.onkeydown = key;


}
